import styled from 'styled-components';
export const HTMLRadio = styled.div `
  display: flex;
  flex-wrap: wrap;
  padding-top: 20px;
  margin-left: -12px;
  margin-right: -12px;
  min-height: 40px;
  align-items: center;
`;
export const HTMLRadioItem = styled.div `
  padding: 0 12px;
  margin-top: 6px;
  margin-bottom: 6px;

  span {
    margin-left: 6px;
  }
`;
//# sourceMappingURL=radio.styled.js.map
